(12, 5, 'deu', 'Current News - Gs;', '<ol>\r\n	<li style=\"text-align: justify;\">\r\n		Edited</li>\r\n	<li style=\"text-align: justify;\">\r\n		Test News.-G 2.New Updates Comming Soon-G .<span style=\"font-size: 12.222222328186px;\">2.</span>New Updates Comming Soon-G .3<span style=\"font-size: 12.222222328186px;\">.</span>New Updates Comming Soon.-G</li>\r\n</ol>\r\n');
