INSERT INTO `ecom_email_contents` (`id`, `unique_name`, `title`, `subject`, `message`, `keywords`, `link_title`, `status`) VALUES
(1, 'MEDIATOR_REGISTRATION', 'Welcome Mediator', 'Welcome to Calling Card', '<p>\r\n	Hello <strong>{{receiver}}</strong> ,</p>\r\n<p>\r\n	You have been registered successfully as a mediator in Callingcard.com.</p>\r\n<p>\r\n	Please click on the link below to login</p>\r\n<p>\r\n	<pp><strong><span style=\"color:#ff0000;\">{{link}}</span></strong></pp></p>\r\n<p>\r\n	<br />\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{receiver}},{{link}}', 'Welcome user 1', 1),
(6, 'CONTACT', 'Get In Touch', 'Enquiry Edited', '<p>\r\n	<span style=\"font-size:16px;\">Hello <strong>{{receiver}}</strong></span></p>\r\n<p>\r\n	<br />\r\n	<span style=\"font-size:16px;\">User : <b>{{name}}</b> wants to contact you. Details are</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Message <b>{{message}}</b></span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Email / Account Number : <b>{{from}}</b></span></p>\r\n', '{{receiver}},{{name}},{{message}},{{from}}', 'Contact', 1),
(5, 'FORGOT_PASSWORD', 'Password Recovery', 'Recover your password Edited', '<p>\r\n	Hello <strong>{{receiver}}</strong></p>\r\n<p>\r\n	Edited</p>\r\n<p>\r\n	Please Click on the link to log in again <b>{{loginlink}}</b></p>\r\n<p>\r\n	Please click on the link to reset your password.<b>{{resetlink}}</b></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{receiver}},{{resetlink}},{{loginlink}}', 'Password', 1),
(7, 'RETAILER_REGISTRATION', 'Welcome Retailer :)', 'Calling Card Welcomes you\'s !!', '<p>\r\n	Hello&nbsp;<strong>{{receiver}}</strong>&nbsp;,</p>\r\n<p>\r\n	You have been registered successfully as a retailer in&nbsp;<span style=\"color: rgb(255, 0, 0);\"><u><strong>Callingcard.com</strong></u></span>&nbsp;by</p>\r\n<p>\r\n	Name :&nbsp;<span style=\"color: rgb(255, 0, 0);\"><strong>{{mediator_name}}</strong></span></p>\r\n<p>\r\n	Email :<span style=\"color: rgb(255, 0, 0);\">&nbsp;<strong>{{mediator_email}}</strong></span></p>\r\n<p>\r\n	Please click on the link below to login</p>\r\n<p>\r\n	<pp><strong>{{link}}</strong></pp></p>\r\n', '{{receiver}},{{mediator_name}},{{mediator_email}},{{link}}', 'Welcome Retailer', 1),
(15, 'RETAILER_MINIMUM_BALANCE_REACH', 'Minimum Balance Reach Mail To Retailer', 'Your balance is Low Edited', '<p>\r\n	Hello <strong>{{retailer_name}}</strong> ,</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Edited</p>\r\n<p>\r\n	You balance is low . Please top up your balance to enjoy the services,</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Details are as following :</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Current Balance : </span><strong style=\"font-size: 12px;\"><strong><strong>&euro;</strong></strong>{{retailer_current_balance}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size: 12px;\">Minimum Required :<strong><strong>&euro;</strong></strong> </span><strong style=\"font-size: 12px;\">{{minimum_balance}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{retailer_name}},{{minimum_balance}},{{retailer_current_balance}}', 'Minimum balance reach retailer', 1),
(8, 'MEDIATOR_FUND_ALLOCATION', 'Fund Allocation To Retailer And Mail To Mediator', 'Fund Allocation To Retailer\'s Edited', '<p>\r\n	Hello <strong>{{mediators_name}}</strong> ,</p>\r\n<p>\r\n	You&nbsp; have successfully allocated amount<b> </b> <b>&euro;{{allocated_amount}}</b> to the the retailer<b> {{retailer_name}}</b>.</p>\r\n<p>\r\n	Details are as following :</p>\r\n<p>\r\n	Your Previous Balance : &euro;<strong>{{mediator_previous_balance}}</strong></p>\r\n<p>\r\n	Your Current Balance : &euro;<strong>{{mediator_current_balance}}</strong></p>\r\n<p>\r\n	Retailer Email Id: <strong>{{retailer_email}}</strong></p>\r\n<p>\r\n	Allocation Date:<strong>{{allocation_date}}</strong></p>\r\n<p>\r\n	<span style=\"color:#ee82ee;\"><strong>The Calling Cards Team</strong></span></p>\r\n', '{{mediators_name}},{{mediator_previous_balance}},{{mediator_current_balance}},{{allocated_amount}},{{retailer_name}},{{retailer_email}},{{allocation_date}}', 'Fund Allocation Mediator To Retailer', 1),
(9, 'MEDIATOR_FUND_ALLOCATION_RETAILER', 'Fund Allocation To Retailer And Mail To Retailer', 'You have successfully allocated fund. Edited', '<p>\r\n	<span style=\"font-size:14px;\">Hello <strong>{{retailer_name}}</strong> ,</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">You&nbsp; have successfully allocated amount &euro;<strong>{{allocated_amount}}&nbsp;</strong> by mediator&nbsp;<strong style=\"font-size: 12px;\">{{mediators_name}}</strong></span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Details are as following <strong>:</strong></span></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size:14px;\">Previous Balance :<strong style=\"font-size: 12px;\"> &euro;{{retailer_previous_balance}}</strong></span></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size:14px;\">Current Balance : <strong style=\"font-size: 12px;\">&euro;{{retailer_total_balance}}</strong></span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Mediator&#39;s Email:&nbsp;<strong style=\"font-size: 12px;\">{{mediator_email}}</strong>&nbsp;</span></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size:14px;\">Allocation Date :<strong style=\"font-size: 12px;\">{{allocation_date}}</strong></span></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{retailer_name}},{{mediators_name}},{{retailer_previous_balance}},{{retailer_total_balance}},{{allocated_amount}},{{mediator_email}},{{allocation_date}}', 'Fund Allocation To Retailer', 1),
(10, 'MEDIATOR_MINIMUM_BALANCE_REACH', 'Minimum Balance Reach Mail To Mediator', 'Your balance is Low Edited', '<p>\r\n	Hello <strong>{{mediators_name}}</strong> ,</p>\r\n<p>\r\n	You balance is low . Please top up your balance to enjoy the services,</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Details are as following :</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Current Balance : </span><strong style=\"font-size: 12px;\">&euro;{{mediator_current_balance}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size: 12px;\">Minimum Required : </span><strong style=\"font-size: 12px;\">&euro;{{minimum_balance}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{mediators_name}},{{minimum_balance}},{{mediator_current_balance}}', 'Minimum balance reach mediator', 1),
(11, 'DISTRIBUTOR_FUND_ALLOCATION', 'Fund Allocation To Mediator And Mail To Distributor', 'Fund Allocation To Mediator\'s Edited', '<p>\r\n	Hello <strong>{{distributor_name}}</strong> ,</p>\r\n<p>\r\n	Edited</p>\r\n<p>\r\n	You&nbsp; have successfully allocated&nbsp; amount<b> &euro;{{allocated_amount}}</b> to the the mediator<b> {{mediators_name}}</b>.</p>\r\n<p>\r\n	Details are as following :</p>\r\n<p>\r\n	Meditor&#39;s Previous Balance : &euro;<strong>{{mediator_previous_balance}}</strong></p>\r\n<p>\r\n	Mediator&#39;s Current Balance : <strong>&euro;{{mediator_current_balance}}</strong></p>\r\n<p>\r\n	Mediator&#39;s Email Id: <strong>{{mediator_email}}</strong></p>\r\n<p>\r\n	Allocation Date:<strong>{{allocation_date}}</strong></p>\r\n<p>\r\n	<span style=\"color:#ee82ee;\"><strong>The Calling Cards Team</strong></span></p>\r\n', '{{distributor_name}},{{mediator_previous_balance}},{{mediator_current_balance}},{{allocated_amount}},{{mediators_name}},{{mediator_email}},{{allocation_date}}', 'Fund Allocation Ditributor To Mediator', 1),
(12, 'DISTRIBUTOR_FUND_ALLOCATION_MEDIATOR_MAIL', 'Fund Allocation To Mediator And Mail To Mediator', 'You have successfully allocated fund. Edited', '<p>\r\n	Hello <strong>{{mediators_name}}</strong> ,</p>\r\n<p>\r\n	Edited</p>\r\n<p>\r\n	You&nbsp; have successfully allocated&nbsp; amount<b> &euro;{{allocated_amount}}</b> by the distributor<b> {{distributor_name}}</b>.</p>\r\n<p>\r\n	Details are as following :</p>\r\n<p>\r\n	Previous Balance : <strong>&euro;{{mediator_previous_balance}}</strong></p>\r\n<p>\r\n	Current Balance : &euro;<strong>{{mediator_current_balance}}</strong></p>\r\n<p>\r\n	Distributor&#39;s Email Id: <strong>{{distributor_email}}</strong></p>\r\n<p>\r\n	Allocation Date:<strong>{{allocation_date}}</strong></p>\r\n<p>\r\n	<span style=\"color:#ee82ee;\"><strong>The Calling Cards Team</strong></span></p>\r\n', '{{mediators_name}},{{distributor_name}},{{mediator_previous_balance}},{{mediator_current_balance}},{{allocated_amount}},{{allocation_date}},{{distributor_email}}', 'Fund Allocation Ditributor To Mediator', 1),
(13, 'RETAILER_PURCHASE_LIMIT_CROSS', 'Purchase Limit Cross Retailer Mail', 'You are exceeding your purchase limit Edited', '<p>\r\n	Hello <strong>{{retailer_name}}</strong> ,</p>\r\n<p>\r\n	Edited</p>\r\n<p>\r\n	You are exceeding your purchase limit</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Details are as following :</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Total Purchase : <strong><strong>&euro;</strong></strong></span><strong style=\"font-size: 12px;\">{{current_purchase}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size: 12px;\">Purchase Limit : <strong><strong>&euro;</strong></strong></span><strong style=\"font-size: 12px;\">{{purchase_limit}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{retailer_name}},{{current_purchase}},{{purchase_limit}}', 'Purchase Limit Cross', 1),
(14, 'RETAILER_PURCHASE_LIMIT_CROSS_MEDIATOR_MAIL', 'Purchase Limit Cross Retailer and Mail To Mediator', 'Your retailer exceeding purchase limit. Edited', '<p>\r\n	Hello <strong>{{mediator_name}}</strong> ,</p>\r\n<p>\r\n	Edited</p>\r\n<p>\r\n	You retailer <strong>{{retailer_name}}</strong> is exceeding &nbsp;their purchase limit.</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Details are as following :</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Total Purchase : <strong><strong>&euro;</strong></strong></span><strong style=\"font-size: 12px;\">{{current_purchase}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<span style=\"font-size: 12px;\">Purchase Limit : <strong><strong>&euro;</strong></strong></span><strong style=\"font-size: 12px;\">{{purchase_limit}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	Retailer&#39;s Email : <strong>{{retailer_email}}</strong></p>\r\n<p style=\"font-size: 12.222222328186px;\">\r\n	<strong style=\"font-size: 12px; color: rgb(238, 130, 238);\">The Calling Cards Team</strong></p>\r\n', '{{mediator_name}},{{retailer_email}},{{retailer_name}},{{current_purchase}},{{purchase_limit}}', 'Purchase Limit Cross Mediator Mail', 1);
